import react, {useState} from "react";
import styles from './index.css';

const CheckBox = (prop) =>{
    const task = [
        {
            id:1,
            name: 'abc',
            check: false
        },
        {
            id:2,
            name: 'def',
            check: true
        }
    ]
    return(
        <form className="CheckBox">
            <input type="checkbox"/>
            <p id="task">{prop.task}</p>
            <input type="button" value="delete"/>
        </form>
    )
} 
export default CheckBox;
